class Solution {
public:
    int maximumXorProduct(long long a, long long b, int n) {
        long long maxVal = (1LL << n) - 1;
        long long maxX = 0;
        for (long long x = 0; x <= maxVal; ++x) {
            long long currentProduct = ((a ^ x) * (b ^ x)) % (1000000007);
            maxX = max(maxX, currentProduct);
        }
        return maxX;
    }
};
